/* ---------------------------------------------
    15. Contact Form Js
 --------------------------------------------- */
$(function() {
    $('form#contact_form').submit(function(e) {
        e.preventDefault(); 
        $('form#contact_form .error').remove();
        var hasError = false;
        var $name = $('form input[id="form_name"]');
        var $email = $('form input[id="form_email"]'); 
        var $message = $('form textarea[id="form_message"]'); 
        var re = /^([\w-\.]+@([\w-]+\.)+[\w-]{2,4})?$/;

        if ($email.val() == '' || !re.test($email.val())){
            $email.parent().append('<span class="error">Please provide valid Email.</span>');
            $email.addClass('inputError');
            hasError = true;
        }
        if($name.val() == '') {
            $name.parent().append('<span class="error">Please provide Your name.</span>');
            $name.addClass('inputError');
            hasError = true;
        }

        if($message.val() == '') {
            $message.parent().append('<span class="error">Please enter message.</span>');
            $message.addClass('inputError');
            hasError = true;
        }
        if(!hasError) {
            var url = "/send_mail"; 
            $.ajax({
               type: "POST",
               url: url,
               dataType: "JSON",
               data: $("#contact_form").serialize()
            })
            .done(function(response) {
                // Make sure that the formMessages div has the 'success' class.
                $('form#contact_form').removeClass('error');
                $('form#contact_form').addClass('success');

                // Set the message text.
                $('form#contact_form > .row').slideUp(300);
                $('form#contact_form').prepend('<span class="success">Thank you. Your email was sent successfully.</span>');

                // Clear the form.
                $("#contact_form")[0].reset();
                // $('form input[name="email"], form input[name="name"], form input[name="subject"], form textarea[name="message"]').val('');
            })
            .fail(function(data) {
                // Make sure that the formMessages div has the 'error' class.
                $('form#contact_form').removeClass('success');
                $('form#contact_form').addClass('error');

                // Set the message text.
                if (data.responseText !== '') {
                    $('form#contact_form').text(data.responseText);
                } else {
                    $('#snackbar').text('Oops! An error occured and your message could not be sent.');
                }
            });
        }
       return false;
    });
});
